        [Dialog action 2]
      </button>
    </div>
  `,
})
export class DialogTemplate {
  constructor(
    public dialogRef: MatDialogRef<DialogTemplate>,
    @Inject(MAT_DIALOG_DATA) public data: DialogData
  ) {}

  onNoClick(): void {
    this.dialogRef.close();
  }
}

