import { Component, Input, OnInit } from '@angular/core';
import { FormControl } from '@angular/forms';
import { MatAutocompleteModule } from '@angular/material/autocomplete';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatInputModule } from '@angular/material/input';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { map, Observable, startWith } from 'rxjs';
import { CommonModule } from '@angular/common';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';

@Component({
  selector: 'storybook-autocomplete',
  standalone: true,
  imports: [
    MatAutocompleteModule,
    MatFormFieldModule,
    FormsModule,
    ReactiveFormsModule,
    CommonModule,
    BrowserAnimationsModule,
    MatInputModule,
  ],
  template: `
    <form class="padding">
      <mat-form-field [appearance]="appearance" [color]="color">
        <mat-label>{{ label }}</mat-label>
        <input
          type="text"
          placeholder="Start typing"
          matInput
          [formControl]="control"
          [matAutocomplete]="auto"
        />
        <mat-autocomplete #auto="matAutocomplete">
          <mat-option
            *ngFor="let option of filteredOptions | async"
            [value]="option"
          >
            {{ option }}
          </mat-option>
        </mat-autocomplete>
      </mat-form-field>
    </form>
  `,
})
export default class Autocomplete implements OnInit {
  @Input() color: 'primary' | 'accent' | 'warn' = 'primary';
  @Input() label!: string;
  @Input() appearance!: 'legacy' | 'standard' | 'fill' | 'outline';

  control = new FormControl('');
  items: string[] = ['Item 1', 'Position 2', 'Level 3'];
  filteredOptions!: Observable<string[]>;

  ngOnInit() {
    this.filteredOptions = this.control.valueChanges.pipe(
      startWith(''),
      map((value) => this.filter(value || ''))
    );
  }

  private filter(value: string): string[] {
    const filterValue = value.toLowerCase();

    return this.items.filter((item) =>
      item.toLowerCase().includes(filterValue)
    );
  }
}

import { CommonModule } from '@angular/common';
import { Component, Input } from '@angular/core';
import { MatButtonModule } from '@angular/material/button';
import { MatIconModule } from '@angular/material/icon';
import { MatProgressSpinnerModule } from '@angular/material/progress-spinner';

@Component({
  selector: 'storybook-button',
  standalone: true,
  imports: [
    MatButtonModule,
    MatIconModule,
    CommonModule,
    MatProgressSpinnerModule,
  ],
  template: `
    <div class="padding">
      <ng-container
        *ngTemplateOutlet="btnTemplate; context: { $implicit: 'small' }"
      >
      </ng-container>
      <br />
      <br />
      <ng-container *ngTemplateOutlet="btnTemplate"> </ng-container>
      <br />
      <br />
      <ng-container
        *ngTemplateOutlet="btnTemplate; context: { $implicit: 'large' }"
      >
      </ng-container>

      <ng-template #btnTemplate let-size>
        <button
          mat-button
          [class.mat-flat-button]="type === 'flat'"
          [class.mat-raised-button]="type === 'raised'"
          [class.mat-stroked-button]="type === 'stroked'"
          class="{{ size }} margin-right"
          [class.round]="round"
          [color]="color"
          [disabled]="disabled"
        >
          <mat-spinner *ngIf="loading"></mat-spinner> {{ label }}
        </button>

        <button
          mat-icon-button
          [class.mat-flat-button]="type === 'flat'"
          [class.mat-raised-button]="type === 'raised'"
          [class.mat-stroked-button]="type === 'stroked'"
          class="{{ size }}"
          [color]="color"
        >
          <mat-icon>home</mat-icon>
        </button>
      </ng-template>
    </div>
  `,
})
export default class Button {
  @Input() label!: string;
  @Input() type!: 'flat' | 'stroked' | 'raised' | 'default';
  @Input() color!: 'primary' | 'accent' | 'warn' | 'default';
  @Input() disabled: boolean = false;
  @Input() loading: boolean = false;
  @Input() round: boolean = false;
}

